                            Oktyabr inqilabından sonra mühacirətə gedən Q.Petrov bu kitabı Serbiyada çap etdirmişdi. Kitab çap olunan kimi Avropanın slavyan xalqları arasında böyük şöhrət qazanmış, təkrar-təkrar nəşr edilərək yayılmışdı. Kitabda Finlandiyanın");
