                            1928-ci ildə türk dilinə çevrilən kitabla tanış olan Atatürk kitabı çox bəyənmiş, onun Türkiyənin məktəblərində, xüsusilə də,hərbi liseylərdə dərs vəsaiti kimi öyrədilməsi barədə əmr vermişdi.
